import React from 'react'
import { drizzleReactHooks } from '@drizzle/react-plugin'
import { newContextComponents } from '@drizzle/react-components'

const { useDrizzle, useDrizzleState } = drizzleReactHooks
const { ContractData, ContractForm } = newContextComponents

export default function CarsList() {

    const { drizzle } = useDrizzle()
    const state = useDrizzleState(state => state)

    const styleForm = {
        display: 'flex',
        flexDirection: 'column',
        gap: '2rem',
        width: '500px'
    }
// https://www.trufflesuite.com/docs/drizzle/react/react-components
    return (
        <div>
            <ContractData
                drizzle={drizzle} // передаем компоненту  drizzle + state
                drizzleState={state}
                contract="BuyCars" // передаем контракт BuyCars
                method="viewCarsList"

            />

            <ContractForm style={styleForm}
                drizzle={drizzle}
                contract="BuyCars"
                method="addCar"
                labels={["BREND","MODEL","PRICE"]}
            />

        </div>
    )
}
